import React, {PureComponent} from 'react';
import {Tabs} from "antd";
import {withRouter} from "react-router";
import loginStyle from './index.module.css';

const {TabPane}=Tabs;

class Login extends PureComponent {

    render() {
        return (
            <div className={loginStyle.login}>
                <Tabs type='card' size='large' tabBarStyle={{fontSize:'18px',fontWeight:'900'}} animated={{inkBar:true,tabPane:true}}>
                    <TabPane tab='企业成员登录' key='member'>

                    </TabPane>
                    <TabPane tab='企业管理员登录' key='administrator'>

                    </TabPane>
                </Tabs>
            </div>
        );
    }

}

export default withRouter(Login);
